import React from 'react';
import './Header.css';
import logoUrl from '../../src/WizelineBootCamp.png';

export const Header = () => {
  return (
      <>
        <div className='header'>
            <img src={logoUrl} alt="Tesla" />

             <div className='carrito'>
                Shopping cart
                Search
             </div>
        </div>

      </>

  )
}
